import React from 'react'
import { Link } from 'react-router-dom';



const NavItem = ({key, text, url, isLast}) => {


  return (
    <li className={'inline-block my-auto w-1/3 border-r-2 border-stone-300' + 'border-l-2'}>
      <Link to={url}>
        <a className='block text-center'>{text}</a>
      </Link>
    </li>
  )
}

export default NavItem
